/**
 * 温湿度同时显示
 */
var $TempAndHumApp = function (sceneManager) {
    $Application.call(this, sceneManager);
    this.canvasMap = {};
    this.billboardMap = {};
    this.humLable = 'humidity';
    this.tempLable = 'temprature';
    this.canvasInfo = {
        width: 322,
        height: 218,
        size: 46,
        lineWidth: 5,
        color: '#FFFFFF',
        startX: 195,
        startY: 93,
        fontFamily: 'Pirulen',
        // bgImage:,

    };
};

mono.extend($TempAndHumApp, $Application, {

    init: function () {
        this.isInit = true;
        var src = 'data:image/png;base64,';

        var enSrc = 'data:image/png;base64,';

        var warningSrc = 'data:image/png;base64,';

        var warningEnSrc = 'data:image/png;base64,';

        if (dataJson.SetLanguage == 'en') {
            this.updateBgImage(enSrc, warningEnSrc);
        } else {
            this.updateBgImage(src, warningSrc);
        }
    },

    updateBgImage: function (src, warningSrc) {
        if (!src) {
            return;
        }
        var image = new Image(),
            warningImage = new Image();
        image.src = src;
        warningImage.src = warningSrc;
        this.canvasInfo.bgImage = image;
        this.canvasInfo.warningBgImage = warningImage;

    },

    resetCamera: function () {
        return false;
    },

    doShow: function () {
        var cMap = this.sceneManager.dataManager._collectors;
        if (!cMap) {
            return;
        }
        var collectors = [];
        for (var id in cMap) {
            var collector = cMap[id];
            if (this.sceneManager.isCurrentSceneInstance(collector.getParentId())) {
                collectors.push(collector);
            }
        }
        if (collectors.length > 0) {
            main.RealtimeDynamicEnviroManager.monitorCollectorData(collectors, true);
            for (var i = 0; i < collectors.length; i++) {
                var billboard = this.createBillboard(collectors[i]);
                if (billboard) {
                    this.sceneManager.network3d.dataBox.add(billboard);
                    this.billboardMap[collectors[i].getId()] = billboard;
                }
            }
        }
        var self = this;
        // this.intervalId = setInterval(function () {
        // 	self.refresh();
        // }, 1000);
    },

    refresh: function () {
        if (!this.billboardMap) {
            return;
        }
        for (var id in this.billboardMap) {
            var billboard = this.billboardMap[id];
            if (billboard) {
                var collector = this.sceneManager.dataManager.getCollectorById(id);
                var twinkle = billboard.getStyle('m.texture.image').twinkle;
                if (collector) {
                    var canvas = this.createCanvas(collector, this.canvasMap[collector.getId()], twinkle);
                    billboard.setStyle('m.texture.image', canvas);
                    billboard.invalidateTexture();
                }
            }
        }
    },

    doClear: function () {
        if (this.intervalId) {
            clearInterval(this.intervalId);
            delete this.intervalId;
        }
        main.RealtimeDynamicEnviroManager.clearMonitorData(true);
        for (var id in this.billboardMap) {
            var billboard = this.billboardMap[id];
            if (billboard) {
                billboard.setParent(null);
                this.sceneManager.network3d.dataBox.remove(billboard);
                it.util.clearBillboardCache(billboard);
            }
        }
        this.billboardMap = {};
        this.canvasMap = {};
    },

    createBillboard: function (collector, canvas) {
        var canvas = this.createCanvas(collector, canvas);
        if (!canvas) {
            return null;
        }
        var billboard = new mono.Billboard();
        var scaleX = canvas.width / 2,
            scaleY = canvas.height / 2;
        billboard.setScale(scaleX, scaleY, 1);
        billboard.setStyle('m.texture.image', canvas);
        billboard.setStyle("m.transparent", true);
        billboard.setStyle("m.alphaTest", 0.5);
        billboard.invalidateTexture();
        var parent = this.sceneManager.getNodeByDataOrId(collector.getParentId());
        if (!parent) {
            return;
        }
        billboard.setParent(parent);
        if (collector.getPosition()) {
            billboard.setPosition(collector.getPosition().clone());
        }
        billboard.setPositionY(billboard.getPositionY() + 500);
        return billboard;
    },

    getColor: function (value) {
        if (!value || parseInt(value) <= 10) {
            return '#3fd4ff';
        } else if (parseInt(value) <= 20) {
            return '#00fe12';
        } else if (parseInt(value) <= 30) {
            return '#fbfe00';
        } else {
            return '#FF0000';
        }
    },

    createCanvas: function (collector, canvas, twinkle) {
        if (!collector || !collector._data) {
            return null;
        }
        var alarmManager = main.sceneManager.getAlarmManager();
        var collectorId = collector.getId();
        var collectorWarning = alarmManager.getAlarmsByDataOrId(collectorId);

        var canvas = canvas || document.createElement('canvas');
        if (collectorWarning && twinkle) {
            var image = this.canvasInfo.warningBgImage;
            canvas.twinkle = false;
        } else {
            canvas.twinkle = true;
            var image = this.canvasInfo.bgImage;
        }
        var color = this.canvasInfo['color'] || '#888888';

        // var width = this.canvasInfo.width,
        //     height = this.canvasInfo.height;
        var context = canvas.getContext('2d');
        // var width = this.canvasInfo.width || this.canvasInfo.width * 2;
        // var height = this.canvasInfo.height || this.canvasInfo.height * 2;
        var width = mono.Utils.nextPowerOfTwo(this.canvasInfo.width);
        var height = mono.Utils.nextPowerOfTwo(this.canvasInfo.height)
        canvas.height = height;
        canvas.width = width;
        if (image) {
            context.drawImage(image, (width - this.canvasInfo.width) / 2, height - this.canvasInfo.height, this.canvasInfo.width, this.canvasInfo.height);
            // const datas = context.getImageData(0, 0, width, height);
            // for (var i = 3; i < datas.data.length; i += 4) {
            // 	datas.data[i] = 150;
            // }
            // context.putImageData(datas, 0, 0);
        } else {
            context.fillStyle = '#FF0000';

            context.rect(0, 0, width, height);
            context.fill();
        }
        var x = parseInt(this.canvasInfo['startX']) || (height - 50);
        var y = parseInt(this.canvasInfo['startY']) || (height - 50);
        var temp = collector._data[this.tempLable] || collector._data['temp'] || collector._data['temperature'] || '0';
        var hum = collector._data[this.humLable] || collector._data['hum'] || collector._data['humidity'] || '0';
        temp = parseFloat(temp).toFixed(1);
        hum = parseFloat(hum).toFixed(1);
        var csize = parseInt(this.canvasInfo['size']) || 80;
        var fontFamily = this.canvasInfo['fontFamily'] || '"Microsoft Yahei"';
        context.font = 'bold ' + csize + 'px ' + fontFamily;
        context.textAlign = 'left';
        context.textBaseline = 'middle';
        context.lineWidth = parseInt(this.canvasInfo['lineWidth']) || 8;
        if (this.canvasInfo['stroke']) {
            // context.strokeStyle = color;
            context.strokeStyle = this.getColor(temp);
            context.strokeText(temp, x, y);
            context.strokeStyle = this.getColor(hum);
            context.strokeText(hum, x, y + 81);
        } else {
            if (dataJson.SetLanguage == 'en') {
                context.fillStyle = this.getColor(temp);
                context.fillText(temp, x + 20, y);
                context.fillStyle = this.getColor(hum);
                context.fillText(hum, x + 15, y + 81);
            } else {
                context.fillStyle = this.getColor(temp);
                context.fillText(temp, x, y);
                context.fillStyle = this.getColor(hum);
                context.fillText(hum, x, y + 81);
            }

        }
        this.canvasMap = this.canvasMap || {};
        this.canvasMap[collector.getId()] = canvas;
        return canvas;
    },
});

it.TempAndHumApp = $TempAndHumApp;